import React from 'react';
/* eslint-disable */
class JsonTable extends React.Component {

    constructor(props) {
        super(props);
    }
    render() {
        return (
           <tr>
               <td>
                   {this.props.data.course_datets}
               </td>
           </tr>
        )
    }
};

export default JsonTable;
